If a test query contains a query evaluated by multiple MR jobs, the corresponding golden file will need to be updated because all dummy TableScanOperators will appear in query plans. If we do not want this kind of updates right now, we can change GenMapRedUtils.createTemporaryTableScanOperator(RowSchema) to use 
{code}
TableScanOperator tableScanOp = (TableScanOperator) OperatorFactory.get(TableScanDesc.class, rowSchema);
{code}
instead of 
{code}
TableScanOperator tableScanOp = (TableScanOperator) OperatorFactory.get(new TableScanDesc(), rowSchema);
{code}
